pragma solidity ^0.4.23;

import "../Math/SafeMath.sol";

contract RoundedCrowdsale {
    using SafeMath for uint256;

    enum buyerPermission {publicVestors, privateVestors, developerVestors, AccessDenied}

    struct Round {
        string name;
        uint256 startTime;
        uint256 endTime;
        uint256 tokensPerETH;
        uint256 minVestingTokens;
        uint256 totalRoundTokens;
        buyerPermission permission;
        bool purchaseIsOpened;
    }

    Round[] crowdsaleRounds;

    constructor(
        uint256 cliff,
        uint256 _PreICOtokensPerETH,
        uint256 _ICORound1tokensPerETH,
        uint256 _ICORound2tokensPerETH,
        uint256 _ICORound3tokensPerETH,
        uint256 _ICORound4tokensPerETH
    ) public {
        crowdsaleRounds[0].name = "preWhitelist";
        crowdsaleRounds[0].startTime = now + cliff;
        crowdsaleRounds[0].endTime = crowdsaleRounds[0].startTime + 10 days;
        crowdsaleRounds[0].permission = buyerPermission.AccessDenied;
        crowdsaleRounds[0].purchaseIsOpened = false;

        crowdsaleRounds[1].name = "preICO";
        crowdsaleRounds[1].startTime = crowdsaleRounds[0].endTime;
        crowdsaleRounds[1].endTime = crowdsaleRounds[1].startTime + 30 days;
        crowdsaleRounds[1].permission = buyerPermission.privateVestors;
        crowdsaleRounds[1].tokensPerETH = _PreICOtokensPerETH;
        crowdsaleRounds[1].minVestingTokens = 625e3;
        crowdsaleRounds[1].totalRoundTokens = 120e3;
        crowdsaleRounds[1].purchaseIsOpened = true;

        crowdsaleRounds[2].name = "Whitelist";
        crowdsaleRounds[2].startTime = crowdsaleRounds[1].endTime;
        crowdsaleRounds[2].endTime = crowdsaleRounds[2].startTime + 10 days;
        crowdsaleRounds[2].permission = buyerPermission.AccessDenied;
        crowdsaleRounds[2].purchaseIsOpened = false;

        crowdsaleRounds[3].name = "ICORound1";
        crowdsaleRounds[3].startTime = crowdsaleRounds[2].endTime;
        crowdsaleRounds[3].endTime = crowdsaleRounds[3].startTime + 1 weeks;
        crowdsaleRounds[3].permission = buyerPermission.publicVestors;
        crowdsaleRounds[3].tokensPerETH = _ICORound1tokensPerETH;
        crowdsaleRounds[3].minVestingTokens = _ICORound1tokensPerETH.div(10);
        crowdsaleRounds[3].totalRoundTokens = 125e3;
        crowdsaleRounds[3].purchaseIsOpened = true;

        crowdsaleRounds[4].name = "ICORound2";
        crowdsaleRounds[4].startTime = crowdsaleRounds[3].endTime;
        crowdsaleRounds[4].endTime = crowdsaleRounds[4].startTime + 1 weeks;
        crowdsaleRounds[4].permission = buyerPermission.publicVestors;
        crowdsaleRounds[4].tokensPerETH = _ICORound2tokensPerETH;
        crowdsaleRounds[4].minVestingTokens = _ICORound1tokensPerETH.div(10);
        crowdsaleRounds[4].totalRoundTokens = 125e3;
        crowdsaleRounds[4].purchaseIsOpened = true;

        crowdsaleRounds[5].name = "ICORound3";
        crowdsaleRounds[5].startTime = crowdsaleRounds[4].endTime;
        crowdsaleRounds[5].endTime = crowdsaleRounds[5].startTime + 1 weeks;
        crowdsaleRounds[5].permission = buyerPermission.publicVestors;
        crowdsaleRounds[5].tokensPerETH = _ICORound3tokensPerETH;
        crowdsaleRounds[5].minVestingTokens = _ICORound1tokensPerETH.div(10);
        crowdsaleRounds[5].totalRoundTokens = 125e3;
        crowdsaleRounds[5].purchaseIsOpened = true;

        crowdsaleRounds[6].name = "ICORound4";
        crowdsaleRounds[6].startTime = crowdsaleRounds[5].endTime;
        crowdsaleRounds[6].endTime = crowdsaleRounds[6].startTime + 1 weeks;
        crowdsaleRounds[6].permission = buyerPermission.publicVestors;
        crowdsaleRounds[6].tokensPerETH = _ICORound4tokensPerETH;
        crowdsaleRounds[6].minVestingTokens = _ICORound1tokensPerETH.div(10);
        crowdsaleRounds[6].totalRoundTokens = 125e3;
        crowdsaleRounds[6].purchaseIsOpened = true;
    }

    function _getCrowdsaleRound() internal view OnlyWhileCrowdsaleNotEnded returns (uint8) {
        for(uint8 i=0; i < crowdsaleRounds.length; i++) {
            if (now > crowdsaleRounds[i].startTime && now < crowdsaleRounds[i].endTime) {
                return i;
            }
        }
    }

    function getCrowdsalePermission() public view returns (buyerPermission) {
        uint8 roundIndex = _getCrowdsaleRound();
        return crowdsaleRounds[roundIndex].permission;
    }

    function getCrowdsaleTokenPerETH() public view returns (uint256) {
        uint8 roundIndex = _getCrowdsaleRound();
        return crowdsaleRounds[roundIndex].tokensPerETH;
    }

    function getCrowdsaleMinVestingTokens() public view returns (uint256) {
        uint8 roundIndex = _getCrowdsaleRound();
        return crowdsaleRounds[roundIndex].minVestingTokens;
    }

    function getCrowdsalePurchaseIsOpened() public view returns (bool) {
        uint8 roundIndex = _getCrowdsaleRound();
        return crowdsaleRounds[roundIndex].purchaseIsOpened;
    }

    modifier onlyWhileTokenIsPurchasable() {
        require(getCrowdsalePurchaseIsOpened());
        _;
    }

    modifier OnlyWhileCrowdsaleNotEnded() {
        require(now > crowdsaleRounds[0].startTime && now < crowdsaleRounds[crowdsaleRounds.length-1].endTime);
        _;
    }
}
